CREATE TABLE "Бирюлёвский дендропарк"."МП0" (
	"Уч." int2 NOT NULL,
	"№" varchar(8) NOT NULL, -- В скобках указан номер площадки по планам 1962 г. ("Проект организации хозяйства Бирюлевского дендропарка", 5-я Московская аэрофотолесоустроительная экспедиция) и 1995 г. ("Проект организации и ведения хозяйства Бирюлевского дендропарка", Центрлеспроект, Парколесоустроительная экспедиция).
	t varchar NOT NULL
);
COMMENT ON TABLE "Бирюлёвский дендропарк"."МП0" IS 'Размещение для первичных данных по маточный площадкам 
«Опись дендрологической коллекции»,
Приложение №3 к предмету охраны объекта культурного наследия регионального значения';

COMMENT ON COLUMN "Бирюлёвский дендропарк"."МП0"."№" IS 'В скобках указан номер площадки по планам 1962 г. ("Проект организации хозяйства Бирюлевского дендропарка", 5-я Московская аэрофотолесоустроительная экспедиция) и 1995 г. ("Проект организации и ведения хозяйства Бирюлевского дендропарка", Центрлеспроект, Парколесоустроительная экспедиция).';


create table "Бирюлёвский дендропарк"."Маточные площадки по паспорту ОКН" as
with b as (
select m."Уч.",
       split_part(m."№", '(', 1)::int2 "№",
       split_part(m."№", '(', 2) "№+",
       m.t like '%трачен%' "Утрата",
       regexp_replace(m.t, '^(У|у)трачен[аоы]?\:?\s', '') t
  from "Бирюлёвский дендропарк"."МП0" m
 )
 select "Уч.",
        "№",
        split_part("№+", ')', 1)::varchar(3) "спец №",
        "Утрата",
        cardinality(regexp_split_to_array(t, ',\s?'))::int2 "Видов на площадке",
        unnest(regexp_split_to_array(t, ',\s?')) "Вид или род"       
 from b;
